import React from 'react';

export default function ShowPost(props) {

    let user = props.location.ForwardedUser;



    return (
        <div>
            <ul className="formSaved">
              {user.map(item => {
                return (

                  <li key={item.id}> {item.value} <button onClick={()=>this.deleteItem(item.id)}> X </button> </li>


                )
              })}
            </ul>

        </div>
    );
}
